(213, 424, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, 'Evercise is an online network that gives \neveryone wanting to exercise access to fitness instructors and classes across London.\nWe understand that if you have a busy lifestyle,\nyou can''t necessarily commit to a rigid fitness regime. That''s what makes Evercise different.\nYou can choose your class by location, trainer or type, and you don''t need to sign up for a whole course at once,\nyou can join on a class-by-class basis.\nYour fitness: your terms. After joining a class, you will receive a booking confirmation with all the useful details\n(you will also receive a handy reminder the day before the class).\nWith Evercise, organising your fitness is easy, fun and flexible.', 'www.evercise.com', '', 'Aerobics Coach'),
(216, 430, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, 'Music festival lovers and fitness fans will be excited to hear that they can now combine their two passions. BIG BURN is a new fitness event that offers a spectacular festival atmosphere with 1,500 people working out together at Alexandra Palace on 30 / 31 May.\n\nSessions will be lead by celebrity instructors, including Darcey Bussell and Josie Gibson who will help you get in shape for the summer!\nLook forward to tons of fun as you and your friends share this unique opportunity to dance your socks off to the rhythm of your favourite fitness idol. You might even forget youâ€™re working out!!', 'http://bigburn.co.uk/index.html', '', 'Aerobics Fitness instructor'),
(217, 436, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, 'Regular Weekly Belly Dancing Classes with Jalya in Central London, near Marble Arch! \nCLASS DAY, TIME, LEVEL, LOCATION AND PRICE\n\nThursday 18:00-19:00 = Beginner/Intermediate. Studio 3. The Seymour Leisure Centre, W1H 5TJ. Â£9 drop-in.\n\nSaturday 15:00-17:00 = Beginner/Intermediate/Advance. Studio 1. The Seymour Leisure Centre, W1H 5TJ. Â£12 drop-in. PLUS BONUS Hula Hooping after the Belly Dancing class for the full core workout! Great Hen Party Weekend Activity Idea!\n\nSimply Drop-in and Pay As You Go!\n\nArt of Belly Dancing classes located at the lovely Seymour Leisure Centre in Marylebone, close to Marble Arch, Paddington and Edgeware Road tube stations. Your expert instructor Jalya will give you a warm welcome to this all abilities class, where you will learn the moves and techniques of Belly Dancing, combining them into a dance with music, followed by a short session of hula hooping at the end, guaranteed to work your abs to the max. Jalya has been a professional dancer and instructor for many years and has appeared in performances across the world including The Royal Albert Hall here in London. Just check out the videos on her website to see her in action! http://www.jalyabellydancer.com/', 'http://www.jalyabellydancer.com/', '', 'Dance Fitness instructor'),
(218, 438, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, 'Fully qualified fitness instructor with background in martial arts.', '', '', 'Kickboxing Fitness instructor'),
(219, 439, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, 'Head trainer Corrie McCallum has dedicated her life to the fitness industry following a career as a professional dancer in the West End.\n\nShe teaches Yoga, Pilates, PT, Nutrition and Meditation to a wide variety of clients and heads up a team of highly qualified trainers.\n\nAll the trainers at Stretch Breathe Smile are considered specialists in their fields and are generally all round lovely chaps!\n\nWe pride ourselves on being a happy, healthy, enthusiastic team and live to spread the fitness love in London!', 'www.stretchbreathesmile.com', '', 'Yoga Personal Trainer'),
(220, 447, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, 'Ginu Azucar\n\nBorn in Colombia in 1974, Ginu started dancing in the late 70â€™s for the Folklorike group â€˜Silvio Dazaâ€™ and â€˜Hugo Benavidezâ€™ dance school. Ginu became passionate about dancing and roller skating, creating his own group when his was 16. He moved to the big city of Santa Fe de Bogota in 1985 to study computer science and joined the folkloric dance group of University Politecnico, Gran Colombiano where he toured and performed around Colombia for 5 years until he finished his studies in 1991.\n\nAfter his degree Ginuâ€™s passion for Latin American rhythms grew and he started learning more continental dancing, such as Rueda de Casino, Pachanga, Boogaloo, Merengue & Cuban salsa, which gave him the extra push to begin teaching when he came to London in 1995. \n\nSince then Ginuâ€™s dancing techniques and rhythms have increased to include, Bachata and Tango. For the last 6 years he has attended Tango and Salsa courses in Buenos Aires, Argentina, Havana, Cuba, Cali and Colombia which lead him to open his own dance studio â€œClub Azucarâ€ in 2005. Ginu is currently teaching and supporting new dance studios across Europe & UK.\n\nI always wanted to be a professional dancer (graduated) but due to the circumstances I ended up studying computer science, which boomed in the middle 80â€™s and helped me sponsor myself as a dancer. I have always been curious about music and dancing, and the benefits and rewards have far outstretched my imagination. I have experienced many dance cultures, but Latin American is one of the most enjoyable, full of expression, delicious food, passionate music and most importantly enthusiastic, friendly and happy people. \n', 'www.clubazucar.co.uk', '', 'Zumba Fitness instructor'),
(221, 449, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, ' Kayla is a qualified pool yoga instructor with 5 years of experience helping swimmers improve strength and flexibility in the pool. She is excited to meet new swimmers and help them improve their practice while decreasing chances of injury. She loves canoeing and camping, and is very happy to be a part of the evercise team', '', '', 'Boot Camp Coach'),
(222, 460, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, 'Born in Colombia, Catalina knows what a real Zumba Party is about. Unmissable! ', 'www.malocauk.com', '', 'Zumba Fitness instructor'),
(223, 462, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, 'Jenny is dedicated to healthy living for life, with 12 years experience as a fitness instructor offering weight management and exercise in order to maintain a healthy body & healthy mind.. Being part of the Evercise team offers the opportunity to meet new people and helping them to adapt to a healthier lifestyle.', '', '', 'Aerobics Fitness instructor'),
(224, 463, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, 'Jenny is dedicated to making you feel Fitter, healthier and happier. With 12 years experience as a fitness Instructor I am happy to be part of the Evercise team ', '', '', 'Aerobics Fitness instructor'),
(225, 465, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, 'I am really good', '', '', 'Aqua Aerobics Coach'),
(226, 467, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, 'After graduate in "Physical Fitness and Health in Sports and Exercise", a specialized and targeted education to deal with the real challenges of Exercise and Health world, I have the necessary skills to develop all the required tasks to work as Fitness Trainer. With 5 years of working experience, I have improved my skills in more specific areas, as Group Exercise Instructor, Team Trainer, Personal Trainer and Fitness Coach.\nBesides that, I also accomplished the curriculum part of a Master in "Exercise and Health", which promoted an increase of knowledge and competences, especially in the areas of Personal Training and Training of Specific Populations as children, pregnant women, elderly, and pathological situations, where I specialized in the fight of obesity by cooperating with a multidisciplinary team, of the Curry Cabral Hospital, who was responsible for the surgical and non-surgical treatment of morbid obesity.\nIâ€™m a dynamic and proactive person, who enjoys team work, and who thinks that continuous formation is indispensable for being ahead in this specific area of Health and Fitness. Moreover Iâ€™m a person who loves his job.\nNow Iâ€™m currently working as Personal Training in Central London and collaborating as well with Munster Fit, and teaching for Aqua Fit Pro and Reebok Sports Club. Besides that Iâ€™m also working for GNC Sports Nutrition UK.\nIn addition I have also experience in the role of teaching, for Academic Education, where I taught Fitness at the Sports Science School of Rio Maior, and for the younger.', 'www.aquafitproltd.co.uk', '', 'Aqua Aerobics Coach'),
