(229, 448, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, 'Hi Iâ€™m Adam Stansbury, a Fat Loss and Nutrition Coach, Founder of Cover Fitness and â€˜Gym Based Personal Trainer of the Year 2013â€™.', 'www.coverfitness.co.uk', '', 'Kettlebell Personal Trainer'),
(230, 479, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, 'Ballet Body Sculpture is a unique fitness exercise program for all women who would like to develop elegance, posture, toned body, flexibility and sculpture the figure of their dreams. \n\nThe classes of Ballet Body Sculpture will improve: \nPosture, Body Line & Grace \nCoordination & Body Balance \nFlexibility, Freedom of Movement & Body Strength \nArticulations & Body Tone \nExpression, Artistry & Confidence \n\nNo previous experience in ballet is necessary to join. The classes are structured using techniques of classical ballet that are combined with stretching and core strengthening exercises of Pilates as well as NLP, unique mind & body connection, that allows to develop a perfect body outline, posture, toned muscles and confidence. Intense but gentle techniques will work out the muscles improving breathing, concentration, relaxation and fluidity.', 'www.balletbodysculpture.com', '', 'Dance Coach'),
(231, 480, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, 'Izabela is certified Beachbody INSANITY trainer, Level 2 REP, fitness and health enthusiast. Her group Insanity Classes help people achieve various fitness goals: weigh loss, body conditioning, getting stronger and fitter. ', 'Www.belivefitness.com', '', 'Strength and Conditioning Fitness instructor'),
(232, 419, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, 'Tanais', '', '', 'Dance Fitness instructor'),
(233, 490, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, 'I am a wellness & transformational coach for children (7-14) & parents. I also love dancing and share this through my dance fitness classes :) \nArriane Eva Morrin\nâ€ Prevention & Transformational coach for Children (7-14) AemHealthandFitness >>> Workshops & Private work \nâ˜¯ Holistic Fitness instructor BellyfitÂ® UK with Aem\nDance Fitness instructor TYGAÂ® UK with Aem\n\nTel: + 44 (0)797 590 4903 \nwww.aemhealthandfitness.com\ninfo@aemhealthandfitness.com', 'www.aemhealthandfitness.com', '', 'Dance Fitness instructor'),
(234, 491, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, 'Burlexercise is a medium - high intensity fitness class designed specifically for an all over body workout. Our classes take you on a physical journey, burning calories, toning and tightening all those problem areas from top to bottom, whilst incorporating token showgirl elements. \n \nOur focus is to get you fit, in shape and feeling body confident but most importantly we''ll make sure you are having fun exercising!\n \nThe creators of Burlexercise have taken inspiration from their careers as London West End dancers, fitness instructors, personal trainers and also professional Burlesque performers to bring you an exercise class like no other!', 'www.burlexercise.co.uk', '', 'Aerobics Fitness instructor'),
(235, 492, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, 'i have been teaching variuos martial arts and boxing for over 28 yrs', 'www.gymlondonsouth.com', '', 'Kickboxing Coach'),
(236, 496, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, 'After injuring her knees and coming upon yoga by mere  curiosity, Dulce has found her way to feel healthier and fitter than ever, lighter and strong at the same time, and of top of it all, she feels happy, which for her should be one of the aims when you practice yoga. \nShe now wants to share yoga to you and get you to experience it. Her yoga practice includes Vinyasa and Power Yoga. ', 'https://www.facebook.com/yogalindolondon', '', 'Yoga Fitness instructor'),
(237, 497, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, 'My name is Adrian and I am from Transilvania. I have been teaching Krav Maga for 8 years in London and operate from Soho Gyms in London Waterloo. I will teach you how to be safe on the streets of London. I will show yuo how to defend yourself against all kinds of attacks, how to escape from Chokes, Locks, Bear Hugs and all kinds of holds. I have classes every week on Mondays and Tuesdays. You learn quickly as there is no theory! We teach only what works! Also the techniques are based on your bodyâ€™s own natural movements and reflexes which really helps with the speed you can learn it. So no awkward long winded fancy looking moves.\n\nYouâ€™ll remember it when you need it to survive.\n\nTry a class and stay safe and keep fit!!', 'www.kravmaga-system.co.uk', '', 'Kickboxing Martial Artist'),
(238, 508, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, 'Rob has a passion for fitness, nutrition and weight management and has been in the industry for 20 years now. Rob had an interest in training from an early age and started training when he was 14. During his time in the industry he has worked as a fitness instructor, Person Trainer and Fitness Manager. Rob has continued to increase his knowledge and has worked with many groups including people with spinal injuries, special populations and Exercise on Referral.\nOver the past 10 years Rob has developed an overwhelming passion for nutrition and is now offering Nutritional Therapy services.\nRob enjoys short intense workouts which give maximum benefit in terms of weight loss, strength and muscle gains and believes that nutrition is vital for achieving maximum results from your training as well as optimum health, wellbeing and illness & disease prevention.', 'www.rjpersonaltrainer.biz', '', 'Fat Loss Personal Trainer'),
