(249, 509, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, 'My name is Jermaine and I developed Bodywise Training to provide a bespoke first class service for achieving health and fitness goals.\n\nI have always lived an active lifestyle, partaking in a variety of sports from a young age, some of which include Basketball, Football and Boxing.\n\nI am an experienced personal trainer based in the City for the last 10 years. I studied at Leeds University where I gained a BSc in Physiology, after which I became a qualified level 3 personal trainer.\n\nHaving worked as an Exercise Physiologist for Nuffield Health medical centres in London, I have developed a holistic approach to health and fitness. I work with my clients not only to improve their physical appearance but also to improve their stress levels, diet and overall lifestyle, in order to achieve long term results.\n\nMy Dockland HIIT classes are a fun and effective way of burning body fat, getting toned and improving cardiovascular fitness in order to get you in the best shape of your life. If you have ever done insanity then you will love this. It is fast, energetic and all about having fun whilst getting results. Results based training at its best...', 'www.bodywisetraining.com', '', 'Tabata Personal Trainer'),
