(254, 459, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, ' Kayla is a qualified pool yoga instructor with 5 years of experience helping swimmers improve strength and flexibility in the pool. She is excited to meet new swimmers and help them improve their practice while decreasing chances of injury. She loves canoeing and camping, and is very happy to be a part of the ever', '', '', 'Bodybuilding Martial Artist'),
(255, 517, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, 'What is Jumping Â® ?\nJumpingÂ® is an original and dynamic fitness workout on patented and specially design JumpingÂ® PROFI trampolines using typical aerobic exercise, however not on solid surface but using a soft trampoline strung in a hexagonal shape. JumpingÂ® is combination of exercises and stretching.\nJumpingÂ® is a safe and fun way to strengthen your body and mind and is specifically designed to suit the needs of all age groups and brings about fun, physical well being and mental balance. This dynamic an exercise is much more than just random hopping on a trampoline. Always accompanied by motivational music, the workout is highly elaborate with every detail well thought through. The combination of fast and slow routines together with dynamic stretching ensures a complex positive effect on burning body fat.\nIt is an excellent way to get in shape and offers a wide range of health benefits and is also guaranteed to strengthen the entire body. The essential part of the JumpingÂ® workout is to develop physical balance and upper core and lower muscles strength. It has positive effects on many parts of the body and is unbelievably efficient. The philosophy is that working out should not be painful; it should be about freedom and the sincere joy of movement.\nThe positive results of a workout are seen and felt in a short time. Users will burn three times more calories than jogging and will not be on solid surfaces where joints could be damaged.\nJumpingÂ® workouts can be done by anyone regardless of age, weight or physical fitness. It does not use complex choreography; it involves simple exercise easily understood by beginners and involves lots of fun. It is perfect for those who want to lose weight, strengthen their character and improve both their fitness their energy levels.', 'www.jumpingfitnessbritain.com', '', 'Aerobics Facilities Manager'),
(256, 516, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, 'JumpingÂ®  is an original and dynamic fitness workout on patented and specially designed JumpingÂ® PROFI trampolines using typical aerobic exercise, however not on a solid surface but using  a soft trampoline strung in a hexagonal shape. JumpingÂ® is combination of exercises and stretching.\nJumpingÂ®  is a safe and fun way to strengthen your body and mind and is specifically designed to suit the needs of all age groups and brings about fun, physical well being and mental balance. This dynamic exercise is much more than just random hopping on a trampoline. It is accompanied by motivational music, and the workout is highly elaborate with every detail well thought out. The combination of fast and slow routines together with dynamic stretching ensures a complex positive effect on burning body fat.\nIt is an excellent way to get in shape, it offers a wide range of health benefits, and it is also guaranteed to strengthen your entire body. The essential part of the JumpingÂ®   workout is to develop physical balance and upper core and lower muscle strength. It has positive effects on many parts of the body and is unbelievably efficient at burning calories. The philosophy is that working out should not be painful; it should be about freedom and the sincere joy of movement. \n\nThe positive results of a workout are seen and felt in a very short time. Users will burn three times more calories than jogging and it is not done on solid surfaces where joints could be damaged.\nJumpingÂ® workouts can be done by anyone  - regardless of age, weight or physical fitness.  It does not use complex choreography; it just involves simple exercise that can be easily understood by beginners andis fun. It is perfect for those who want to lose weight, strengthen their character and improve both their fitness and their energy levels.\n', 'www.jumpingfitnessbritain.com', '', 'Jumping Julia'),
(257, 522, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, 'Mark has nearly 30 years experience in coaching fitness and martial arts athletes from a range of physical disciplines. He is highly knowledgeable and enthusiastic about Functional Fitness Training having spent years working some the very best combat athletes. He has a relaxed coaching style which makes him great fun to work with. Come see for yourself.', 'www.gymlabfitness.com', '', 'Strength and Conditioning Coach'),
(258, 527, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, 'I came to Pilates as rehabilitation for my own back pain caused by Scoliosis and immediately fell in love with this exercise method. It brought me greater mobility, alignment and ease. I decided to train and qualified as a teacher for both mat and equipment Pilates. I also went on to complete further training in Exercise Management for Low Back Pain. I continue to extend my knowledge and interest in the human body by attending training courses.\nI have a very hands on approach to teaching and thoroughly enjoy working with clients to encourage confidence, space and freedom of movement within their own bodies.', '', '', 'Pilates Physical Activity instructor'),
(259, 526, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, 'I came to Pilates as rehabilitation for my own back pain caused by Scoliosis and immediately fell in love with this exercise method. It brought me greater mobility, alignment and ease. I decided to train and qualified as a teacher for both mat and equipment Pilates. I also went on to complete further training in Exercise Management for Low Back Pain. I continue to extend my knowledge and interest in the human body by attending training courses. I have a very hands on approach to teaching and thoroughly enjoy working with clients to encourage confidence, space and freedom of movement within their own bodies.', '', '', 'Pilates Physical Activity instructor'),
(260, 528, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, 'Specialist in Nutrition, Fat Loss, Stress Relief and Pain Reduction / Elimination\nTo me, Personal Training is exactly that - Personal\nMy belief is that effective communication and the ability to encourage and motivate are the best skills needed to train people - NOT to bully them!\nThat''s why it is important to establish a relationship so that we can work out what may be stopping you from achieving your goals and face any potential issues together', 'www.strictlyleemiller.co.uk', '', 'Fat Loss Personal Trainer'),
(261, 542, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, 'Netball Coach, Triathlon Coach, Leader in Runner Fitness, passionate about introducing kids to a lifestyle of sports and fitness, and bringing adults back into sports and a fit life they once enjoyed', '', '', 'Beginner''s Fit Fitness instructor'),
(262, 547, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, ' I am a Personal Trainer at The Gym Group Ealing and I''m mobile so I can travel out to people''s homes, parks etc based within a 8 mile radius from Twickenham as well as train in The Gym Ealing.', '', '', 'Nutrition Personal Trainer'),
(263, 425, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, 'gegsdg', '', '', 'Body Sculpting Fitness instructor'),
(264, 550, '0000-00-00 00:00:00', NULL, NULL, 0, 0, NULL, NULL, NULL, NULL, 'Fabrice is a natural motivator and leader, an Ex-Amateur Boxer, Qualified Gym instructor,football coach, tennis coach, \nPrevious to setting up Muscle Hustle  was a Sports Facilitator for The Prince''s Trust designing sports programs for youth that focused on developing their interpersonal skills through exercise, sports and physical activities.\nProvides 1 to 1 sessions as well  as couples sessions, group sessions, bootcamps and corporate fun days.\nUsing a wide range of training tactics and methods from Boxercise sessions to strength  training to high intensity to fun game drills and more.\nWhatever your fitness goals maybe he''s your solution and will guide, support and motivate you to achieving them. ', 'www.muscle-hustle.co.uk', '', 'Boxercise Fitness instructor');
