(19, 71, 'Upper Body Blitz', 1, 'An explosive upper body class using the best and most effective techniques. Based in Holborn for a great start to your morning.', 1, 1, 12, 8.00, '', '2013-11-09 12:52:00', 'Lincolns Inn Field, London WC2A 3TL', '-0.1144831', '51.51643', '001.jpg', '/users/71_Peter_ATP/groups/', NULL, NULL, '00:45', 1, 1, 6, NULL),
(20, 72, 'Legendary Legs', 1, 'Sculpt and strengthen your lower body with a workout based in the Holborn area, guaranteed to give you a workout like never before. ', 1, 1, 12, 10.00, '', '2013-09-26 07:30:00', 'Lincolns Inn Field, London WC2A 3TL', '-0.1144831', '51.51643', 'legendary002.jpg', '/users/72_Waynne_ATP/groups/', NULL, NULL, '00:45', 0, 1, 4, NULL),
(21, 72, 'ATP Studio Kickboxing', 1, 'Join us for a fun, hard and educational kickboxing workout in a studio in Central London that will challenge anyone.', 1, 1, 10, 10.00, '', '2013-10-08 11:00:00', 'LA Fitness Waldorf (Covent Garden - Under Hilton Waldorf Hotel),Hilton Waldorf Hotel,WC2B 4DD', '-0.11938110000005508', '51.51264200000001', '72-image.jpg', '/users/72_Waynne_ATP/groups/', NULL, NULL, '01:', 0, 1, 2, NULL),
(22, 72, 'Bootcamp - Tuesday Body Blitz', 1, 'Burn fat, build lean muscle, improve your fitness, train hard whilst still feeling that individual service in a group of friendly people with the same goals as you! Join us for our results based outdoor class where we have cover for when the weather gets &quot;tricky&quot;.', 1, 1, 10, 5.00, '', '2013-12-03 07:30:00', 'Lincolns Inn Fields,London,WC2A 3TL', '-0.11664389999998548', '51.5160338', '72-image.jpg', '/users/72_Waynne_ATP/groups/', NULL, NULL, '45', 1, 1, 12, NULL),
(23, 72, 'Bootcamp Thursdays with ATP', 1, 'No matter the weather or your current fitness ability, you will be covered during this class which will burn fat, build lean muscle, get your body moving better than before and all of this done in a group who are looking for the same things you are. Join ATP Fitness in the park, get the results and have some fun!', 1, 1, 10, 5.00, '', '2013-11-21 07:30:00', 'lincolns Inn Field,London,WC2B 3LJ', '-0.11964549999993323', '51.51428980000001', '72-0002.jpg', '/users/72_Waynne_ATP/groups/', NULL, NULL, '45', 1, 1, 14, NULL),
(24, 72, 'High Intensity Body Sculpt', 1, 'Sculpt, tone, build and burn! This class will get your body moving with weight training, plyometrics, cardio, core and more. Join ATP Fitness for a truly effective workout for guys and girls!', 1, 1, 15, 5.00, '', '2013-11-14 12:30:00', 'LA Fitness Waldorf (Under the Hilton Hotel),London,WC2B 4DD', '0.11938110000005508', '51.51264200000001', '72-shutterstock_124015816.jpg', '/users/72_Waynne_ATP/groups/', NULL, NULL, '60', 1, 1, 2, NULL),
(25, 71, 'HIIT Training', 1, 'A high intensity cardio resistance based session designed to leave you feeling pumped, focused and ready for anything. Combining high intensity cv exercises and speed resistance training-this is a workout not to be missed.', 1, 1, 15, 10.00, '', '2013-11-23 11:00:00', 'LA FITNESS WALDORF HOTEL,Aldwych ,Wc2b 4dd', '-0.11745040000005247', '51.51318999999999', '71-image.jpg', '/users/71_Peter_ATP/groups/', NULL, NULL, '60', 1, 1, 2, NULL),
(26, 71, 'Ladies only kickboxing', 1, 'Martial arts based workout for ladies only. Great way to stress bust and keep fit.', 1, 1, 10, 19.00, '', '2013-09-25 07:30:00', 'Lincolns Inn Field,London,wc2A 3TL', '-0.116667', '51.516267', 'ATP_andy001.jpg', '/users/71_Peter_ATP/groups/', NULL, NULL, '45', 1, 1, 5, NULL),
(27, 72, 'Outdoor Kickboxing', 1, 'Want to learn a new skill, release some tension, tone that body or just have a great workout? Then join us for kickboxing in the park!', 1, 1, 10, 10.00, '', '2013-10-30 07:30:00', 'Lincolns Inn Fields,Holborn,wc2a 3tl', '-0.11448310000002948', '51.51643019999999', 'ATP_andy001.jpg', '/users/72_Waynne_ATP/groups/', NULL, NULL, '45', 1, 1, 12, NULL),
(28, 237, 'Pilates (all levels)', 3, 'A conditioning class designed to improve muscle tone and flexibility and to improve general posture. This class is great for the first timer to the more advanced. It can help with sports injuries and pre / /post natal.', 1, 5, 15, 10.00, '', '2013-11-30 11:00:00', 'La Fitness Waldorf, Aldwich,London,wc2b 4dd', '-0.11938110000005508', '51.51264200000001', '237-1_display_pic.jpg', '/users/237_PilateswithScot/groups/', NULL, NULL, '60', 1, 1, 1, NULL),
(29, 237, 'Pilates for all levels', 4, 'Pilates will help to tone and stretch the muscles. It also helps to improve posture and strengthen core muscles. Great for injury rehabilitation.', 1, 5, 15, 10.00, '', '2013-11-30 11:00:00', 'La Fitness, Waldorf Hotel, Aldwych,,WC2B 4DD', '-0.11745040000005247', '51.51318999999999', '237-436._ADV_single_leg_raise.jpg', '/users/237_PilateswithScot/groups/', NULL, NULL, '60', 1, 1, 1, NULL),
(31, 240, 'Special Saturday Vinyasa Flow', 3, 'A one-off Saturday Vinyasa Flow class, from 1-2pm on Saturday 7th December at our Angel space, in the Upper Hall at Claremont.  Expect a flowing class that uses creative sequencing and accompanying music to flow through postures designed to increase your heart rate, calm your nervous system and boost energy levels for the weekend An even balance of challenge and chill for those that like a little sweat with their stretch. A perfect addition to your weekend. ', 1, 2, 20, 10.00, '', '2013-12-07 13:00:00', 'Upper Hall, Claremont, 24-27 White Lion Street,London,N1 9PD', '-0.10851900000000114', '51.5327292', '240-1476605_570101706389408_409676528_n.jpg', '/users/240_StretchingCity/groups/', NULL, NULL, '60', 1, 1, 2, NULL),
(32, 71, 'Studio Yoga', 1, 'Yoga is an ancient form of exercise that focuses on strength, flexibility and breathing to boost physical and mental wellbeing. This yoga class is appropriate for beginners that help you go beyond your normal range of movement. Yoga is an all-round work-out focusing on both mind and body. Your mind will be relaxed, your face will be radiant and  you will feel your body full of vitality.', 1, 5, 15, 10.00, '', '2013-11-23 11:00:00', 'LA FITNESS WALDORF HOTEL,Aldwych ,Wc2b 4dd', '-0.11745040000005247', '51.51318999999999', '71-shutterstock_yoga.jpg', '/users/71_Peter_ATP/groups/', NULL, NULL, '60', 1, 1, 1, NULL),
(33, 104, 'Swag Hip-Hop', 1, 'A great workout /dance based class great for cardio and taught by a professional commercial dancer Matt Knight.   &#039;Let the energy move you!&#039;', 1, 5, 15, 10.00, '', '2013-11-30 10:00:00', 'LA FITNESS WALDORF ,Aldwych Covent garden ,Wc2b4dd', '-0.11879709999993793', '51.5135229', '104-image.jpg', '/users/104_Swagsteps/groups/', NULL, NULL, '60', 1, 1, 1, NULL),
(34, 262, 'HIIT Training', 3, 'High intensity resistance training intervals in a gym based environment for a workout you&#039;ll never forget hitting arms legs abs and core this class will leave you pumped and ready for anything ', 1, 5, 15, 10.00, '', '2013-12-07 11:00:00', 'LA Fitness Waldorf ,Aldwych,WC2B 4DD', '-0.11745040000005247', '51.51318999999999', '262-image.jpg', '/users/262_Asafontaine/groups/', NULL, NULL, '60', 1, 1, 1, NULL),
(35, 71, 'Gym-tastic', 1, 'Use the gym like never before in this man vs machine, gym based workout. Sprint training , core blasting will leave your muscles screaming for more.', 1, 5, 10, 10.00, '', '2013-11-23 12:00:00', 'LA Fitness Waldorf,Aldwych ,Wc2b4dd', '-0.11745040000005247', '51.51318999999999', '71-image.jpg', '/users/71_Peter_ATP/groups/', NULL, NULL, '60', 1, 1, 1, NULL),
