(104, 497, 'Krav Maga Self Defence Classes', 2, 'You will be taught different techniques to escape chokes, holds, locks and many more. Learn how to deal with multiple attackers, knife attacks and stick attacks. \n\nYou learn quickly as there is no theory! We teach only what works! Also the techniques are based on your bodyâ€™s own natural movements and reflexes which really helps with the speed you can learn it. \n\nYou will need to wear trainers, t shirt and tracksuit bottoms and please bring a bottle of water.\n\nChanging rooms available. \n', 1, 1, 18, 10.00, 'We will teach you how to defend your self against all kinds of attacks. Easy to learn techniques.', '2014-06-11 11:09:48', 'Soho Gyms,Waterloo,SE1 8TG', '-0.108933200000024', '51.5039221', 'IMG_1121_-_Version_2.jpg', '/users/497_KravMagaSystem/groups/', NULL, NULL, '90', 1, 1, 18, NULL),
