(117, 1, 'test', 2, 'This will be visible on the class page. Here you have a bit more room to describe the details of your class. You could explain what a participant will be expected to do and what they can expect to gain, suggest suitable clothing, list the facilities available at the venue (e.g. changi', 1, 1, 8, 6.50, 'test', '2014-06-18 14:53:30', '23 oman avenue,london,nw2 6ax', '-0.226796199999967', '51.5564077', 'tmnt.jpg', '/users/1_mewis/groups/', NULL, NULL, '15', 1, 1, 0, NULL),
(118, 508, 'Personal Training', 1, 'Whether you wish to lose body fat, improve your muscle tone and shape or increase muscular strength and size I can help you. By applying the principles of High Intensity Training and Nutrition you can achieve maximum results in the minimum amount of time.\n\nWhat is included in my PT packages?\n\nEffective Exercise\n\nWith the logical application of High Intensity Training principles I can help you to lose weight, improve your shape and muscle tone, increase lean muscle development and strength.', 1, 1, 2, 30.00, 'What to lose bodyfat? Improve muscular shape ', '2014-06-18 15:19:09', '6 sutton park road,sutton,sm12np', '-0.194934099999955', '51.3603106', 'RJ_Logo_v1.jpg', '/users/508_Rob Cahill/groups/', NULL, NULL, '60', 1, 1, 0, NULL),
(119, 508, 'Nutrition ', 4, 'By using a non-judgemental approach and working with you to making gradual dietary and lifestyle changes I can help you achieve health improvements and/or sustainable weight loss.\n\nThe calories in verses calories out approach to weight loss has validity but is an over simplification of effective weight loss. The inflammatory and hormonal effects that many commonly consumed foods have on our bodies can prevent weight loss and damage our health.', 1, 1, 1, 30.00, 'Improve your energy! Improve your vitality! Improve your health!', '2014-06-18 15:38:17', '6 sutton park road,sutton,sm1 2np', '-0.194934099999955', '51.3603106', 'Metabolic_typing_icon.png', '/users/508_Rob Cahill/groups/', NULL, NULL, '60', 1, 1, 0, NULL),
(120, 508, 'Nutritional Therapy', 4, 'Nutritional therapy is a complementary therapy, meaning it can work alongside orthodox medicine. It is a way of using food and supplements to encourage the bodyâ€™s natural healing.  Nutritional therapy can help a wide range of individuals, and benefits may be found a wide range of conditions, including:\nHigh Blood Pressure\nDiabetes\nDepression\nMigraine\nPMS\nOverweight\nPCOS\nLow Energy', 1, 1, 1, 30.00, 'With advice on diet and lifestyle we can help alleviate or prevent ailments!', '2014-06-18 15:56:50', '6 sutton park road,sutton,sm12np', '-0.194934099999955', '51.3603106', 'nutrition_icon.png', '/users/508_Rob Cahill/groups/', NULL, NULL, '60', 1, 1, 0, NULL),
(121, 1, 'whompe', 3, 'This summary will appear in the Class Panel under the title. Use your words wisely to explain as concisely and clearly as possible what a participant can hope to gain from joining your class.', 1, 1, 13, 6.50, 'This summary will appear in the Class Panel under the title. Use your words wisely to explain as con', '2014-06-20 16:06:12', '1 fetter lane,london,', '-0.109332799999947', '51.5144023', 'sonic.jpg', '/users/1_mewis/groups/', NULL, NULL, '15', 1, 1, 0, NULL),
(122, 516, 'Adults Jumping Nation Drop in', 1, 'The complex JumpingÂ® routines are accompanied by careful stretching exercises to make sure you leave the class energized and feeling comfortable in your body. As the programme is just taking off in London, we are currently offering beginnersâ€™ classes but we are ready to grow together with our clients.  Jumping Â® is an excellent way to get in shape and offers a wide range of health benefits. It has positive effects on all major systems of the human body and is unbelievably efficient. ', 1, 1, 17, 10.00, 'Dynamic aerobic exercising on patented JumpingÂ® PROFI trampoline is led by our professional instruc', '2014-06-20 20:13:51', '3 Bletchley Street,London,N1 7QG', '-0.0914884999999686', '51.5313911', '6251.jpg', '/users/516_Julia/groups/', NULL, NULL, '45', 1, 1, 2, NULL),
(123, 522, 'StrikeLab Fitness', 1, 'Our StrikeLab classes are our own unique blend of conventional Kickboxing and functional fitness training, giving you the ultimate high intensity fitness workout.\n\nBased on the concept of striking (hitting) focus pads and/or heavy bags, you will use your hands, elbows, knees, and legs to power your way through a range of challenging timed intervals. This class truly simulates the experience of combat to push your fitness further.', 1, 1, 20, 10.00, 'High Intensity Interval Training', '2014-06-25 10:44:01', 'The London Wing Chun Academy, 2nd Floor Cypress House, 2 Coburg Road, Wood Green,London,N22 6UJ', '-0.113136800000007', '51.5946521', 'StrikeLab-Fitness-4.jpg', '/users/522_londonwingchun/groups/', NULL, NULL, '45', 1, 1, 15, NULL),
(124, 522, 'GymLab Functional Fitness ', 1, 'This is a fun, fast paced coached class using functional equipment, heavy lifts, interval drills, and team work. You will work hard, but you will never train on your own.\n\nKettlebells, Powerbags, Battle Ropes, Barbells, Pylo Boxes, hurdles, boxing, and bodyweight drills are just some of what we utilise to give you the ultimate fat burning and metabolism boosting workout. \n\nGymLab classes are open to individuals of any fitness ability or physical condition.', 1, 1, 20, 10.00, 'HiiT ~ Group Fitness Training', '2014-06-25 10:59:22', 'The London Wing Chun Academy, 2nd Floor Cypress House, 2 Coburg Road, Wood Green,London,N22 6UJ', '-0.113136800000007', '51.5946521', 'GymLab-London-2.jpg', '/users/522_londonwingchun/groups/', NULL, NULL, '45', 1, 1, 10, NULL),
(125, 526, 'Hot Pilates', 5, 'Hot Pilates is great for all ages and fitness levels, as the class can be modified to suit your need', 1, 1, 15, 15.00, 'Hot Pilates movements increase the health and flexibility of the spine whilst training the muscles.', '2014-06-30 14:04:34', '96 Kensington High Street,London,W8 4SG', '-0.192201999999952', '51.5015777', 'pilates.jpg', '/users/526_Rebecca97/groups/', NULL, NULL, '60', 1, 1, 1, NULL),
