(128, 542, 'Running Scared', 1, 'In the summer term we have been focussing on technique, in the Autumn term we''ll move back to distance. This class is still small enough to run as one group, with progressions and challenges for the more experienced runners, so that everyone gets a great workout. Followed by a coffee and a chat afterwards of course! TERM TIME ONLY', 1, 1, 20, 2.00, 'Friendly group of runners of all abilities, beginners welcome, plenty to keep experienced active too', '2014-07-06 09:19:52', ',guildford,GU2 7QS', '-0.60086780000006', '51.2345619', 'running-scared-hi.png', '/users/542_Mamagarner/groups/', NULL, NULL, '45', 1, 1, 2, NULL),
(129, 447, 'Zumba Fitness in Chiswick ', 1, 'Leran the real, organic and authentic Zumba with Club Azucar in Chiswick Club Society every Wednesday @ 7pm, enjoy, dance and exercise at the same\nFirst class Â£5, then pay as you go Â£7 or block lesson deals', 1, 1, 30, 7.00, 'Join my Club Azucar - Zumba fitness and learn to dance ', '2014-07-08 17:51:07', '11-13 Chiswick High Rd,Chiswick,', '-0.245858799999951', '51.4931279', 'chiswick_board_2013.jpg', '/users/447_Ginuazucar/groups/', NULL, NULL, '60', 1, 1, 18, NULL),
(130, 492, 'strength ', 1, 'light warm up, then various weighted exercises or body weight exercises, timed with repetitions, or sprint based cardio work out, staircase runs included,', 1, 1, 10, 7.00, 'double your strength and maintain your size ', '2014-07-09 16:22:49', '14 Menin Works,Mitcham,cr4 3hg', '-0.166176299999961', '51.4084939', 'DSC_0141.jpg', '/users/492_Winston Newton/groups/', NULL, NULL, '45', 1, 1, 16, NULL);
INSERT INTO `classinfo` (`classInfoId`, `Uid`, `classInfoName`, `classInfoCategory`, `classInfoDescription`, `classInfoDeadline`, `classInfoMin`, `classInfoMax`, `classInfoPrice`, `classInfoSubtitle`, `classInfoCreateTime`, `classInfoAddress`, `classInfoLongitude`, `classInfoLatitude`, `classInfoImageName`, `classInfoImageAddress`, `classInfoPDFName`, `classInfoPDFAddress`, `classInfoDuration`, `classInfoPublished`, `classInfoProApproved`, `classInfoDatesAdded`, `classSpecialPrice`) VALUES
(131, 492, 'ABA Boxing', 2, 'Classes are generally broken into three different sections,1st  footwork, skipping, agility ladder, shadow boxing, 2nd boxing defensive techniques, slipping, ducking, rolling, lay back, push away, attacking punching combo''s with defensive moves on the pads, then technical sparring and defensive sparring when the body is the only attackable target no head sparring until you have sufficent skills to defend yourself ', 1, 1, 20, 7.00, 'Specialized Boxing skills Footwork, Defense, Attack, combo''s technical sparring', '2014-07-09 16:48:58', 'Unit 14, Menin Works, Bond Road,,Mitcham,cr4 3hg', '-0.166176299999961', '51.4084939', 'DSC_0452.jpg', '/users/492_Winston Newton/groups/', NULL, NULL, '90', 1, 1, 16, NULL),
(132, 492, 'Core ', 3, 'Core strengthening Exercise and Stretching to to remove the possibilities of injuries, increase our range of mobility, keeping us subtle and flexible. adding to our longjevity in this sport', 1, 1, 20, 3.00, 'Core strengthening Exercise and Stretching', '2014-07-09 17:04:46', 'Unit 14, Menin Works, Bond Road, ,Mitcham,CR4 3HG', '-0.166176299999961', '51.4084939', 'DSC_0006.jpg', '/users/492_Winston Newton/groups/', NULL, NULL, '30', 1, 1, 16, NULL),
(133, 492, 'Kick Boxing', 3, 'we have competed in this sport for over 25 years, and have followed the many transitions, as a learning style we have kept the good stuff that works and dropped the rubbish flash stuff that can only get you into trouble, only old fashioned training method are taught, with some modern ways to implement our regime', 1, 1, 20, 7.00, 'Kick Boxing and K1, combination of boxing and kicking ', '2014-07-09 17:23:09', 'Unit 14, Menin works, Bond Road.,Mitcham,CR4 3Hg', '-0.166176299999961', '51.4084939', 'DSC_0039.jpg', '/users/492_Winston Newton/groups/', NULL, NULL, '90', 1, 1, 7, NULL),
(134, 492, 'Thai Boxing', 3, 'The art of 8 Limbs boxing, as taught by our resident 3x European Heavy weight Champion, Kru Barry from Vos Gym Rotterdam, kru has a vast amount of knowledge pertaining to the striking sport as he has tried them all and only Thai boxing could quench his thirst for knowledge, come down and share it', 1, 1, 20, 10.00, 'The art of 8 Limbs boxing, ', '2014-07-09 17:38:06', 'Unit 14, Menin Works, Bond road.,Mitcham,CR4 3HG', '-0.166176299999961', '51.4084939', 'DSC_0123.jpg', '/users/492_Winston Newton/groups/', NULL, NULL, '90', 1, 1, 13, NULL),
(135, 492, 'Ladies only Training', 3, 'this class is perfect for the ladies who want to learn a martial art / self defense whilst toning up, No men are allowed in the building and the doors are locked,', 1, 1, 10, 10.00, 'This class is for ladies only specializing in boxing, kick boxing ', '2014-07-09 18:06:29', 'Unit 14, Menin Works, Bond Road.,Mitcham.,CR4 3HG', '-0.166176299999961', '51.4084939', 'DSC_0444.jpg', '/users/492_Winston Newton/groups/', NULL, NULL, '120', 1, 1, 3, NULL);
