(606, 71, 'Studio Yoga', '1', '', 'Yoga is an ancient form of exercise that focuses on strength, flexibility and breathing to boost physical and mental wellbeing. This yoga class is appropriate for beginners that help you go beyond your normal range of movement. Yoga is an all-round work-out focusing on both mind and body. Your mind will be relaxed, your face will be radiant and  you will feel your body full of vitality.\n', 1, '2013-11-23 11:00:00', '', '', '', 11, 5, 15, '0000-00-00 00:00:00', 0, 0.01, '', '', '', '', '', '0000-00-00 00:00:00', '', '', '', 'LA FITNESS WALDORF HOTEL,Aldwych ,Wc2b 4dd', '-0.11745040000005247', '51.51318999999999', '', '71-shutterstock_yoga.jpg', '../../users/71_Peter_ATP/groups/', '', NULL, 0, 0, 0, '60', '', '', '', 0, 1, 1, 1, 0, 1, 0, NULL),
