(614, 240, 'Special Saturday Vinyasa Flow', '3', '', 'A one-off Saturday Vinyasa Flow class, from 1-2pm on Saturday 7th December at our Angel space, in the Upper Hall at Claremont. \nExpect a flowing class that uses creative sequencing and accompanying music to flow through postures designed to increase your heart rate, calm your nervous system and boost energy levels for the weekend An even balance of challenge and chill for those that like a little sweat with their stretch. A perfect addition to your weekend. ', 1, '2013-12-07 13:00:00', '', '', '', 8, 2, 20, '0000-00-00 00:00:00', 0, 0.01, '', '', '', '', '', '0000-00-00 00:00:00', '', '', '', 'Upper Hall, Claremont, 24-27 White Lion Street,London,N1 9PD', '-0.10851900000000114', '51.5327292', '', '240-1476605_570101706389408_409676528_n.jpg', '../../users/240_StretchingCity/groups/', '', NULL, 0, 0, 0, '60', '', '', '', 0, 1, 0, 1, 0, 1, 0, '10'),
